Write a function in Javascript to generate a random number between 1 and 100.
```javascript
/**
 * Generates a random number between 1 and 100.
 * 
 * @returns {number} A random number between 1 and 100.
 */
function generateRandomNumber() {
  // Generate a random number between 1 and 100
  return Math.floor(Math.random() * 100) + 1;
}
```
This function uses the `Math.random()` function to generate a random number between 0 (inclusive) and 1 (exclusive). The `Math.floor()` function is then used to round down the number to the nearest integer, and finally 1
